import React from 'react';
// import './nav-bar.css';

class About extends React.Component {
  constructor(props) {
    super(props);
  }

  render() {
    return (
        <div>
          <h1>About Young Learning</h1>
          <img src="studious-girl.png"/>
          <div>
            Information about young learning here.
          </div>
        </div>
    );
  }
}

export default About;
